  name: TravelIDMappingTableInfo
  nameWithType: TravelIDMappingTableInfo
  fullName: SuperOffice.CRM.Data.TravelIDMappingTableInfo
  type: Class
  assemblies:
  - SoDataBase
  namespace: SuperOffice.CRM.Data
  summary: "Table 'travelidmapping': Mapping of primary keys between Travel databases and the mother database  All travel database transactions get a high id to be able to see that this entry came from a database outside the central database. When update files are read into the central database, they get a normal low id. This table remembers the high travel id to map it to the low central id as long as this travel user is travelling."
  remarks: >-
    An instance of this class represents one instance of this table in an SQL statement. In most

    cases each table appears only once in a SELECT, but in cases where you need to self-join, or

    there are multiple occurrences for other reasons (typically additional restrictions in the joins),

    then you will need multiple instances. <br />

    Instances of this class are created by calling TablesInfo.GetTravelIDMappingInfo().
